import React, { Component } from 'react';

class GameHeader extends Component {
    render() {
        return (
            <div navigationOptions = {{
                headerTitleStyle: { alignSelf: 'center' },
                title: 'Center Title',
            }}>Hello from GameHeader</div>
        )
    }
}
export default GameHeader;
